// Import the functions you need from the SDKs you need
import firebase from "firebase/compat/app";
import "firebase/compat/database";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
var firebaseConfig = {
    apiKey: "AIzaSyAxuyvWeijNjGGMri1r50ygl3_pV5R3uMY",
    authDomain: "junglewildlifemagazine.firebaseapp.com",
    databaseURL: "https://junglewildlifemagazine-default-rtdb.asia-southeast1.firebasedatabase.app",
    projectId: "junglewildlifemagazine",
    storageBucket: "junglewildlifemagazine.appspot.com",
    messagingSenderId: "913150301775",
    appId: "1:913150301775:web:4862747d5a37c001507c3a",
    measurementId: "G-B4L2L376VX"
};

// Initialize Firebase
const fireDb =firebase.initializeApp(firebaseConfig);

export default fireDb.database().ref();
